import React from 'react'

const Cases = () => {
    return (
        <div className="container">
            <h4 className="center">Cases</h4>
            <p>Total Cases:</p>
            <p>Weekly Cases:</p>
            <p>Daily Cases:</p>
        </div>
    )
}
export default Cases
